typedef struct M10A005_Probe {
    int enabled;
    int sequence;
    int issue;
} M10A005_Probe;

M10A005_Probe m10a005_probe(void) {
#if __OBJC3_FEATURE_NULLABILITY_CANONICAL_NORMALIZATION__
